import { makeStyles } from '@mui/styles';

export default makeStyles((theme) => ({
  container: {
    height: '80vh', 
    width: '100%', 
  },
  mainGrid: {
    height: '455px', 
    width: '100vw',
    position: 'relative', 
    overflow: 'hidden', 
  },
  sidebar: {
    height: '100%',
    width: '38%',
    position: 'absolute',
    left: '0',
    transition: 'transform 1s ease-in-out'
  },
  sideBarDiv: {
    height: '100%',
    width: '100%',
    display: 'flex',
    flexDirection: 'column-reverse',
    alignItems: 'center',
    justifyContent: 'center',
    color: '#fff',
  },
  mainSlide: {
    height: '100%',
    position: 'absolute',
    top: '0',
    left: '40%',
    width: '100%',
    transition: 'transform 1s ease-in-out',
  },
  mainSlideDiv: {
    height: '100%',
    width: '100%',
    background: 'rgba(99, 99, 99, 0,15)',

  }
}))
